About: Bond is back! James Bond? No, dummy. RENE BOND! She's shaken and stirred in these ass-tounding goo-fests. Private Private features hard-up hero Jefferson Figg, (Ric Lutze) a private detective who has his own theme song. Figg is set up as the fall guy in a bank heist and balls his way through a cast of starlets and harlots searching for clues. High on energy (but low on talent) this carnal comedy features a lesbian named tester, an outdoor sex romp and a &quot;sleeping gas&quot; bomb. Miss Bond plays &quot;Hilda McTash&quot; who takes Figg to her ''playroom&quot;. She also has a steamy 3-way involving an oriental beauty. This is a whodunit in which everybody &quot;does it&quot;!
